        x //= base
    return ''.join(digits[::-1])

def fib4(n: int):
    if n < 0:
        raise ValueError("n must be non-negative")
    if n <= 1:
        return 0
    if n == 2:
        return 2
    if n == 3:
        return 0

    a, b, c, d = 0, 2, 0, 0
    for _ in range(4, n + 1):
        a, b, c, d = b, c, d, a + b + c + d

    return d

def modp(n: int, p: int):
    if n == 0:
        return 1
    result = 1
    base = 2
    while n > 0:
        if n & 1:
            result = (result * base) % p
        base = (base * base) % p
        n >>= 1
    return result

